import React, { useState } from 'react';
import { Grid, Typography, Button, Box, Popover, IconButton, Drawer, List, ListItem, ListItemText, Divider, Collapse } from '@mui/material';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import GetMyProperty from '../assets/newlogo1.png';
import { useNavigate } from 'react-router-dom';
import { useMediaQuery, useTheme } from '@mui/material';
import { ArrowDropDown, } from '@mui/icons-material';
import ArrowDropUp from '@mui/icons-material/ArrowDropUp';
import HomeIcon from '@mui/icons-material/Home';
import DesignServicesIcon from '@mui/icons-material/DesignServices';
import GroupIcon from '@mui/icons-material/Group';
import ConnectWithoutContactIcon from '@mui/icons-material/ConnectWithoutContact';
import FeedIcon from '@mui/icons-material/Feed';
import ContactsIcon from '@mui/icons-material/Contacts';
import ModelTrainingIcon from '@mui/icons-material/ModelTraining';
import CollectionsIcon from '@mui/icons-material/Collections';
// import ArrowDropUpIcon from '@mui/icons-material/ArrowDropUp';
// import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

const Header1 = () => {
    const navigate = useNavigate();
    const [anchorEl, setAnchorEl] = useState(null);
    const [drawerOpen, setDrawerOpen] = useState(false);
    const theme = useTheme();
    const isMobile = useMediaQuery(theme.breakpoints.down('md'));
    const isTablet = useMediaQuery(theme.breakpoints.between('sm', 'md'));

    const handlePopoverOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMouseEnter = () => {
        setAnchorEl(anchorEl); // keep popover open on hover
    };

    const handleMouseLeave = () => {
        setAnchorEl(null);
    };

    const handleMouseOver = () => {

    };

    const handlePopoverClose = () => {
        setAnchorEl(null);
    };

    const toggleDrawer = (open) => () => {
        setDrawerOpen(open);
    };

    const open = Boolean(anchorEl);


    const [ope, setOpe] = useState(false);

    const handleClick = () => {
        setOpe(!ope);
    };

    return (
        <Grid container spacing={2} mb={-3} backgroundColor={'#e3f2fd'} >
            <Grid item xs={12} md={2} sx={{ display: 'flex', alignItems: 'center', justifyContent: isMobile ? 'space-between' : 'flex-start' , mt:2}}>
            {isMobile && (
                    <Grid sx={{ mb: { md: 5, xs: 0 } , cursor: "pointer",ml:3,mt:2}}>
                        <img
                            src={GetMyProperty}
                            alt="GetMyProperty"
                            width={60}
                            onClick={() => navigate('/')}
                        />
                    </Grid>
                )} 
                 {!isMobile && (
                    <Grid container 
                     sx={{ mb: { md: 5, xs: 0 }, cursor: "pointer", mt:1,justifyContent:'center' }}>
                        <img
                            src={GetMyProperty}
                            alt="GetMyProperty"
                            width={50}
                            onClick={() => navigate('/')}

                        />
                    </Grid>
                )}

                {isMobile && (
                    <IconButton
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        onClick={toggleDrawer(true)}
                        sx={{ mr: 3, mt: 1 }}
                    >
                        <MenuIcon />
                    </IconButton>
                )}
            </Grid>

            <Grid item xs={12} md={10} sx={{ mb: 2 , mt:2}}>
                <Grid container sx={{ flexDirection: 'column', gap: '20px' }}>

                    {/* Drawer for Mobile */}
                    <Drawer anchor="left" open={drawerOpen} onClose={toggleDrawer(false)}>
                        <Box
                            sx={{
                                width: 250,
                                display: 'flex',
                                flexDirection: 'column',
                            }}
                        >
                            <Grid sx={{ mb: { md: 5, xs: 1 } , cursor: "pointer",ml:3,mt:2 , justifyContent: 'space-between',}}>
                            <img
                            src={GetMyProperty}
                            alt="GetMyProperty"
                            width={60}
                            onClick={() => navigate('/')}
                        />

                                {/* <IconButton onClick={toggleDrawer(false)} sx={{ml:'auto'}}>
                                    <CloseIcon />
                                </IconButton> */}
                          </Grid>
                            <Divider />
                            <List >
                                <ListItem button onClick={() => navigate('/')}>
                                    <HomeIcon sx={{ mr: 2 }} />
                                    <ListItemText primary="Home" />
